WHY WE HOMESCHOOL
Well, the longer we do it, the longer our answer gets,😆 but for starters:

🕰️TIME: Time together, time to not rush their childhood, time to pursue passions and exiting the busywork/homework cycle. 

📚EDUCATION: Being able to incorporate our faith, see their learning first hand, meet their individual needs and not be strapped to arbitrary government standards.

🧠HEALTH: being able to sleep, eat and move when needed, to daily be outdoors, and to avoid situations that compromise a child’s mental health (peer orientation, academic labels etc). 

