Living books are a key piece of a Charlotte Mason education. She constantly stressed the importance of exposing our children to beauty and richness through books with the most excellent literary quality we can find. Living books don’t talk down to children, and they spark delight in a child. 

But how do we know a book is “living” when it’s a subjective concept? I’ve learned to spot a living book in two ways:

1. The Counterfeit Method: The more I read books off of living book lists, the more I get used to the qualities of a living book and am able to spot one “in the wild”. 😆

2. The Enjoyment Method: If the book is a joy to read, if it impacted me, if it stuck with me somewhere in my soul—then I know it’s a living book!

A living book will not be the same for everyone, but worthy ideas of justice, compassion, adventure, friendship and love, perseverance and mercy—those are the same! 

