📖CREATING A HOME LIBRARY📖
There is one question I ask myself when curating our home library collection and it is this:

Will I use this book? 

That’s it: Will we use it for school, will I read it again, or is this copy in readable (usable) condition? 

There are too many books in this world and too little shelf space in my home to keep books that aren’t useful and of the best quality. 

