Charlotte Mason’s first principle is “Children are born persons” and it has changed so much for me personally. 

This principle radically upholds the value of children and their own God-given uniqueness. Their mind is “as complete and as beautiful as his beautiful little body” as Charlotte Mason said. 

It has changed how I parent and speak to my children. Viewing them as full people makes me question—would I talk to another adult this way?  Am I honoring their own personhood in my instruction, discipline and guidance?

It has changed how I teach my children. They are not vessels to be filled or blank slates to make into what I want. It is not my job to shape or fill their minds but rather to fan the intuitive flame of curiosity rather than snuff it out. 

"…His mind is the instrument of his education…his education does not produce his mind." Charlotte Mason

