Let’s talk learning gaps.

The worry about learning gaps is rooted in fear: fear of not being a good home educator, fear of failing our children or even fear of the future. 

But here’s the thing:

🌱Learning is a lifestyle. There is no finish line! 

✏️All educations have gaps. I think we can all identify things in our own education that we’re missed. 

💻Your child can’t learn “everything they need to know” because we don’t even know what that is. Think of all of the things you’ve had to learn as an adult that weren’t even possible/invented when you were a child!

📚A homeschool education will have gaps…because it should! We’re offering our kids a customized education fit to their interests and needs, not a one-sized fits all. 

