Our homeschool atmosphere is what defines our homeschool. 

"Education is an atmosphere, a discipline, and a life,” says Charlotte Mason. Atmosphere is one of the three major tools we are given to influence a child’s education. 

➡️➡️As a homeschooling mother, I have great freedoms to set the tone and atmosphere of our homeschool. I am the one choosing the schedule, curating the environment and deciding what kind of educational experience my child will have. 

🤔So, if mothers impact the atmosphere of home and ultimately their child's learning, what is impacting mothers? Well, let’s talk about hormones. 

Hormones are constantly impacting a woman's mood, motivation, energy levels, focus and relationships. All of this impacts the atmosphere of education.

🎉 New in my shop today is my Homeschooling with Hormones eBook! 🎉

This eBook will detail for you what is happening in your body during each of the four phases of your cycle. It will walk you through how these hormonal changes impact each area of your life (spiritual, physical, relational, emotional) and how you can plan your homeschool (self-care, nutrition and movement) to work with your hormones and not against it. 

By becoming educated about your body with gaining knowledge and understanding and with a little bit of intentional planning, you can make your hormones work for the good of your homeschool atmosphere. 

