The Charlotte Mason method is more than living books. It is more than spending time outside every day. And it’s more than a feast of beautiful and worthy ideas. 

But those things initially drew me to Charlotte Mason. 

I remember scrolling Pinterest for hours looking at info about the wonder weeks and toddler activities with my firstborn child, because I was eager and overwhelmed and SO uncertain in my brand new role as mother. 

Somehow I stumbled about blogs about homeschooling and specifically about Charlotte Mason. 

This lifestyle of freedom, beauty, knowledge and ideas quickly became idyllic to me. 

When I read about living books and nature study and poetry and personhood, it just clicked with me in the deepest recesses of my soul and I knew I would do anything to give that kind of an education and life to my child. 

And it has been idyllic, in many ways. Not to say it hasn’t been hard, but I look back at the hopes of that new mom who was up all night rocking her baby and I see so many wishes fulfilled. 

I don’t want to be hyperbolic, but Charlotte Mason has truly changed my life. And for that I feel forever grateful. ❤️

This #charlottemasonmonday we’re all sharing what drew us to CM, and I hope you’ll check out their stories! 

