Of course a child’s education is for them…but is it? 

Charlotte Mason said “There is no education but self-education”. 

If you’re offering all the bells and whistles and prizes to get facts memorized and crammed into their head, it’s not self-education. 

If you’re putting in more effort than your child is, it is not self-education. 

If you’re doing a song and dance to make the knowledge more entertaining to the child, it’s not self-education. 

If you are pre-digesting all the information and then presenting it to your child with all the dots already connected, it’s not self-education. 

If you are the source of all the knowledge, it is not self-education. 

As a Charlotte Mason educator, I am to be a friend, a philosopher and a guide to my child in their self-education. They must take hold of knowledge for themselves. 

Because if their education is not primarily for them and from them, it is not true, lasting education. 

