We get to choose where we spend our energy this holiday season. 

What if we spent our energy focused on Jesus? 

Heading into Christmas, my goal is not to make every baked good, do every craft and read every book. 

But it is to know Jesus more, see the beauty of His birth and make space to connect with my family in a meaningful way. 

We’re doing this by adding in Signs of the Savior at Christmas to our schooling and being protective of our “yes” this December. 

